	set rootDir="C:\varian\"
	set folders=$lb("inbound.adt","inbound.adt.archive","inbound.adt.ack","outbound.mdm","outbound.dft","outbound.hprim")
	for i=1:1:$listlength(folders) {

		set dir=rootDir_$list(folders,i)
		write "Attempting to create "_dir,!
		if ( 'trueForDelete ) {
		 if ##class(%File).DirectoryExists(dir) {
			write dir_" already exists.",!
			continue
		 }
		}
		if (trueForDelete) {
			set sc=##class(%File).RemoveDirectoryTree(dir)
		} else {
			set sc=##class(%File).CreateDirectoryChain(dir)
		}
		if ( $$$ISERR(sc) ) {
			write "Error creating "_dir,!
			write $system.Status.DisplayError(sc)
		} else {
			write:'trueForDelete "Created directory "_dir,!
			write:trueForDelete "Removed directory "_dir,!
		}
	}
	Do %code.WriteLine(" Quit  // Dummy - called for compile side-effects")
