Method.Implementation:

set ^foo=$ZTS
for i=1:1:$length(..#SETTINGS,",") {
	set setting=$piece($piece(..#SETTINGS,",",i),":",1)
	set ^varian.service.settings(sessionId,setting)=$property($this,setting)
}
quit $$$OK

try {

	$$$TRACE("OnProcessInput")
	merge ^http($i(^http))=pInput.Attributes
	set url = $zconvert(pInput.Attributes("URL"),"l")
	if ( url = "/echo" ) {
		do ..echo(pInput,.pOutput)
	} elseif ( url = "/hello" ) {
		Set pOutput=##class(%Stream.TmpCharacter).%New()

		do pOutput.WriteLine("Hello")
	} elseif ( url = "/config" ) {
		Set pOutput=##class(%Stream.TmpCharacter).%New()
		do pOutput.WriteLine("InboundHTTPAriaEvent")
		do pOutput.WriteLine("HTTPEndpoint="_..HTTPPostEndpoint)
		do pOutput.WriteLine("TargetConfigName="_..TargetConfigName)

	} elseif ( url = "/stat" ) {
		// to-do return status info
		Set pOutput=##class(%Stream.TmpCharacter).%New()
		do pOutput.WriteLine("/stat NOT IMPLEMENTED")

	} elseif ( url = ..HTTPPostEndpoint ) {
		// fire off requests 	
		do ..handleEvent(pInput,.pOutput) 

	} else {
		set pOutput= ##class(%Library.GlobalBinaryStream).%New()
		//set pOutput.Attributes("ResponseCode")="HTTP/1.1 404 Not Found"
		set pOutput.Attributes("ResponseCode")="404 Not Found"

	}
} catch error {
	$$$TRACE("error ----> " _ error.DisplayString())
	Set pOutput=##class(%Stream.TmpCharacter).%New()
	do pOutput.Write( error.DisplayString() ) 
	throw error
}
quit $$$OK

try {
	//do ..parseEventStream(pInput,.event)
	set xdoc=##class(EnsLib.EDI.XML.Document).ImportFromLibraryStream( pInput )
	// lookup doc type based on /Event/Name
	do pInput.Rewind()
	set eventName = ..findEventName(pInput)
	$$$TRACE("eventName="_eventName)
	set ^v($i(^v),"eventName")=eventName
	if ( '$data( ^varian.maps("Event",eventName,"DocType")) ) {
		throw ..exp("No DocType mapping for event="_eventName)
	}
	set docType = ^varian.maps("Event",eventName,"DocType")
	set ^v($i(^v),"docType")=docType
	$$$TRACE("docType="_docType)
	set xdoc.DocType = docType
	Set target=$ZStrip(..TargetConfigName,"<>W")  
	// if target="" throw error!
	///$$$THROWONERROR(sc,..SendRequestAsync(target,xdoc,"Event from Varian"))
	$$$THROWONERROR(sc,..SendRequestSync(target,xdoc,.response,,"Sync Event from Varian"))
	$$$TRACE("Sync response="_response)
} catch error {
	// any extra logging?
	throw error
}
quit $$$OK

set pOutput=##class(%Stream.TmpBinary).%New()
do pInput.Rewind()
while ( 'pInput.AtEnd ) {
	do pOutput.Write( pInput.Read() )
}
quit $$$OK

$$$THROWONERROR(sc,##class(%XML.TextReader).ParseStream(input,.reader))
set currentPath = ""
set event = ##class(varian.msgs.EventMessage).%New()
set event.Data=""
while ( reader.Read() ) {
	if ( reader.Path = "/Event/Name" ) {
			if ( reader.HasValue ) {
				return reader.Value
			}
	}
}
throw ..exp("No /Event/Name found")

$$$THROWONERROR(sc,##class(%XML.TextReader).ParseString(eventXml,.reader))
set currentPath = ""
set event = ##class(varian.msgs.EventMessage).%New()
set event.Data=""
while ( reader.Read() ) {
	//write "reader.Path=",reader.Path," reader.HasValue=",reader.HasValue,! //" reader.NodeType=",reader.NodeType," reader.HasValue=",reader.HasValue,!
	if ( reader.Path = "/Event/Name" ) {

			if ( reader.HasValue ) {
				set event.Name = reader.Value 
				//write "event = ",event,!
			continue
		}
		continue
	}
	if ( reader.Path [ "/Event/EventData/" ) {

		if ( reader.HasValue  ) {
			set key=$piece(reader.Path,"/Event/EventData/",2)
			//set event.Data(key) = reader.Value
			set event.Data=event.Data_$lb($lb(key,reader.Value))
			//write "event(",key,")=",event(key),!
			set currentPath = ""	
		}
	}
}

